let imgUrl_00 = 'data:image/jpeg;base64,';
let imgUrl_01 = 'data:image/jpeg;base64,';
let imgUrl_02 = 'data:image/jpeg;base64,';
let imgUrl_03 = 'data:image/jpeg;base64,';
let imgUrl_04 = 'data:image/jpeg;base64,'
let imgUrl_05 = 'data:image/jpeg;base64,';
let imgUrl_06 = 'data:image/jpeg;base64,';
let imgUrl_07 = 'data:image/jpeg;base64,';
let imgUrl_08 = 'data:image/jpeg;base64,';
let imgUrl_09 = 'data:image/jpeg;base64,';

document.addEventListener('DOMContentLoaded', function () {
    const body = document.body;
    const randomNumber = Math.floor(Math.random() * 10); // Generate a random number between 0 and 9.

    // Store your image URLs in an array
    const imgUrls = [
        imgUrl_00,
        imgUrl_01,
        imgUrl_02,
        imgUrl_03,
        imgUrl_04,
        imgUrl_05,
        imgUrl_06,
        imgUrl_07,
        imgUrl_08,
        imgUrl_09,
    ];

    // Get the random URL based on the random index (randomNumber)
    const randomUrl = imgUrls[randomNumber];

    // Set the backgroundImage with the random URL
    body.style.backgroundImage = `url(${randomUrl})`;

    // half image size is '364px 204px'
    body.style.backgroundSize = '728px 408px';
});
